import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#f50057', // Change this to your primary color
    },
    secondary: {
      main: '#ba000d', // Change this to your secondary color
    },
  },
});

export default theme;
